INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 2, 102301, 2, "アヤネ", "2030/12/17 14:59:59", 401, "2020/07/31 12:00:00", 24, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 24001);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 2.21, 2, 102301, 1, "アヤネ", "2030/12/17 14:59:59", 402, "2020/07/31 12:00:00", 24, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 24002);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 2, 102301, 2, "アヤネ", "2030/12/17 14:59:59", 403, "2020/07/31 12:00:00", 24, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 24003);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 1.99, 1, 192201, 2, "アサヒ", "2030/12/17 14:59:59", 701, "2020/07/31 12:00:00", 24, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 24004);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 2.21, 2, 192201, 1, "アサヒ", "2030/12/17 14:59:59", 702, "2020/07/31 12:00:00", 24, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 24005);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 3.33, 1, 192201, 2, "アサヒ", "2030/12/17 14:59:59", 703, "2020/07/31 12:00:00", 24, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 24006);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 2, 192301, 2, "部員３", "2030/12/17 14:59:59", 801, "2020/07/31 12:00:00", 24, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 24007);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 2.68, 2, 192301, 1, "部員３", "2030/12/17 14:59:59", 802, "2020/07/31 12:00:00", 24, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 24008);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 2, 192301, 2, "部員３", "2030/12/17 14:59:59", 803, "2020/07/31 12:00:00", 24, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 24009);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 1, 192501, 1, "", "2030/12/17 14:59:59", 501, "2020/07/31 12:00:00", 24, 0.0, "やった！", 0.0, 24010);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 1, 192501, 1, "", "2030/12/17 14:59:59", 502, "2020/07/31 12:00:00", 24, 0.0, "勝ったよ！", 0.0, 24011);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 1, 192501, 1, "", "2030/12/17 14:59:59", 503, "2020/07/31 12:00:00", 24, 0.0, "いい調子！", 0.0, 24012);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 5.33, 2, 113501, 6, "ミサト", "2030/12/17 14:59:59", 111, "2020/07/31 12:00:00", 24, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 24013);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 6.85, 2, 113501, 1, "ミサト", "2030/12/17 14:59:59", 112, "2020/07/31 12:00:00", 24, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 24014);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 3.0, 2, 113501, 1, "ミサト", "2030/12/17 14:59:59", 113, "2020/07/31 12:00:00", 24, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 24015);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 6.11, 2, 192401, 1, "ダイチ", "2030/12/17 14:59:59", 611, "2020/07/31 12:00:00", 24, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 24016);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 6.75, 2, 192401, 1, "ダイチ", "2030/12/17 14:59:59", 612, "2020/07/31 12:00:00", 24, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 24017);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 2, 192401, 2, "ダイチ", "2030/12/17 14:59:59", 613, "2020/07/31 12:00:00", 24, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 24018);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 4.52, 1, 113401, 2, "ハツネ", "2030/12/17 14:59:59", 211, "2020/07/31 12:00:00", 24, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 24019);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 3.89, 1, 113401, 2, "ハツネ", "2030/12/17 14:59:59", 212, "2020/07/31 12:00:00", 24, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 24020);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 13.49, 2, 113401, 1, "ハツネ", "2030/12/17 14:59:59", 213, "2020/07/31 12:00:00", 24, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 24021);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 3.17, 2, 106501, 1, "カヤ", "2030/12/17 14:59:59", 311, "2020/07/31 12:00:00", 24, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 24022);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 4.42, 2, 106501, 1, "カヤ", "2030/12/17 14:59:59", 312, "2020/07/31 12:00:00", 24, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 24023);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 2.89, 1, 106501, 6, "カヤ", "2030/12/17 14:59:59", 313, "2020/07/31 12:00:00", 24, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 24024);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 3.71, 3, 102301, 4, "アヤネ", "2030/12/17 14:59:59", 421, "2020/07/31 12:00:00", 24, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 24025);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 5.1, 1, 192201, 2, "アサヒ", "2030/12/17 14:59:59", 721, "2020/07/31 12:00:00", 24, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 24026);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 4.34, 3, 192301, 1, "部員３", "2030/12/17 14:59:59", 821, "2020/07/31 12:00:00", 24, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 24027);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 1, 192501, 1, "", "2030/12/17 14:59:59", 521, "2020/07/31 12:00:00", 24, 0.0, "いい勝負だったよ\nまたやろうね", 0.0, 24028);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 5.62, 2, 113501, 1, "ミサト", "2030/12/17 14:59:59", 101, "2020/07/31 12:00:00", 24, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, 24029);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 9.58, 2, 113501, 1, "ミサト", "2030/12/17 14:59:59", 102, "2020/07/31 12:00:00", 24, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, 24030);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 0.0, 2, 113501, 2, "ミサト", "2030/12/17 14:59:59", 103, "2020/07/31 12:00:00", 24, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 24031);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 9.13, 1, 113501, 2, "ミサト", "2030/12/17 14:59:59", 104, "2020/07/31 12:00:00", 24, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, 24032);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 8.27, 2, 113501, 1, "ミサト", "2030/12/17 14:59:59", 105, "2020/07/31 12:00:00", 24, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, 24033);
